import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaHeart, FaUser, FaShoppingCart, FaSearch, FaMinus, FaPlus } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';
import './Electronics.css'; // Make sure this path matches your CSS file's location

function Electronics() {
  const navigate = useNavigate();
  const [products, setProducts] = useState([]); // Initialize products as an array
  const [cartItems, setCartItems] = useState({});

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        // Update this URL to match your actual API endpoint
        const response = await axios.get('http://localhost:8000/api/products/electronics');
        if (Array.isArray(response.data)) { // Ensure that the response is an array
          setProducts(response.data);
        } else {
          console.error('Expected an array of products, received:', response.data);
        }
      } catch (error) {
        console.error('Error fetching products:', error);
      }
    };

    fetchProducts();
  }, []);

  const addToCart = (productName) => {
    setCartItems((prevItems) => ({
      ...prevItems,
      [productName]: (prevItems[productName] || 0) + 1,
    }));
  };

  const increaseQuantity = (productName) => {
    setCartItems((prevItems) => ({
      ...prevItems,
      [productName]: prevItems[productName] + 1,
    }));
  };

  const decreaseQuantity = (productName) => {
    setCartItems((prevItems) => ({
      ...prevItems,
      [productName]: Math.max(0, prevItems[productName] - 1),
    }));
  };

  const renderCartButton = (productName) => {
    const count = cartItems[productName] || 0;
    return count > 0 ? (
      <div className="quantity-controls">
        <button onClick={() => decreaseQuantity(productName)}><FaMinus /></button>
        <span>{count}</span>
        <button onClick={() => increaseQuantity(productName)}><FaPlus /></button>
      </div>
    ) : (
      <button className="add-to-cart-button" onClick={() => addToCart(productName)}>
        Add to Cart <FaShoppingCart />
      </button>
    );
  };

  return (
    <div className="Electronics">
      <header className="Electronics-header">
        <h1 className="logo" onClick={handleHome}>ShopNow</h1>
        <div className="header-right">
          <div className="search-container">
            <input type="text" placeholder="Search for products" className="search-input" />
            <FaSearch className="search-icon" />
          </div>
          <FaHeart className="icon" />
          <FaUser className="icon" onClick={handleProfile} />
          <FaShoppingCart className="icon" onClick={handleCart} />
        </div>
      </header>
      <nav className="Electronics-nav">
        <ul>
          <li onClick={handleHome}>Home</li>
          <li onClick={handleClothing}>Clothing</li>
          <li onClick={handleCart}>Cart</li>
          <li onClick={handleProfile}>Profile</li>
        </ul>
      </nav>
      <main className="Electronics-main">
        {products.length > 0 ? (
          products.map((product) => (
            <div className="product-card" key={product.name}>
              <img src={product.url} alt={product.name} />
              <h3>{product.name}</h3>
              <div style={{display: 'flex', marginTop: "10px"}}>
                <p>${product.price}</p>
                {renderCartButton(product.name)}
              </div>
            </div>
          ))
        ) : (
          <p>No products found.</p>
        )}
      </main>
      <footer className="Electronics-footer">
        <p>&copy; ShopNow - Built With Love</p>
      </footer>
    </div>
  );
}

export default Electronics;
